import style from './Form.module.css';
import { useState } from 'react';

const Form = () => {
    const [userData, setData] = useState({
        email: email,
        password: password
    })

    const handleChange = (event) => {
        setData((event.target.value));
    }

    return(
        <form>
            <label htmlFor='email'>Email:</label>
            <input type='email' name='email' placeholder='Ingresa tu mail' value={email} onChange={handleChange}></input>

            <label htmlFor='password'>Contraseña:</label>
            <input type='password' placeholder='Ingresa tu contraseña' value={password} onChange={handleChange}></input>'

            <button type='submit'>Enviar</button>
        </form>
    )
};

export default Form;
